import pflText from "../Assets/pflt.png";
import Table from "../Table.js";
import "./points.css";
export default function Points() {
  return (
    <div>
      <img
        src={pflText}
        alt="Logo"
        style={{
          display: "block",
          margin: "auto",
          width: "300px",
          marginTop: "20px",
        }}
      />
      <div className="table">
        <div className="card">
          <p className="card-header-name" style={{width: "10px"}}>Club Name</p>
          <p className="card-header-played">MP</p>
          <p className="card-header-won">W</p>
        </div>
      </div>
      <div class="d-flex justify-content-center">
        <div class="spinner-border" role="status">
          <span class="sr-only" id="loading"></span>
        </div>
      </div>
    </div>
  );
}
